(1, 'iphone', 'iphone 4s			', 'http://www.aoyouw.com/up_img/2012-01/s050030410.jpg#', 999999, '', '<p>\r\n\n	<strong>玩乐最前沿&mdash;&mdash;苹果 iPod touch 4代</strong></p>\r\n\n', '2012-05-03 01:47:44'),
(2, '苹果MACBOOK AIR', '		', 'http://www.aoyouw.com/up_img/2012-01/s032136210.jpg#', 1999999, '', '<strong><span style=\\"\\\\\\''font-size:16px;\\\\\\''\\">可靠、快速、高效，就是苹果MACBOOK AIR！</span></strong><p><span style=\\"\\\\\\''FONT-SIZE:\\" 14px=\\"\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 苹果Apple MACBOOK AIRMC505CH/A 11.6英寸笔记本电脑</span></p><p><span style=\\"\\\\\\''FONT-SIZE:\\" 14px=\\"\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 如果你已拥有 iPod、iPhone 或 iPad，你就正享用着闪存带来的一切优势：可靠、快速、高效。因此，在 MacBook Air 这样一台超小巧的笔记本电脑上使用闪存，就再适合不过了。</span></p><p><span style=\\"\\\\\\''FONT-SIZE:\\" 14px=\\"\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 闪存可让你迅速读取数据，并为 MacBook Air 带来长达 30 天待机时间的惊人表现。不论你在一天之后、一周之后还是一个月之后重新打开 MacBook Air，它都能够瞬间启动。</span></p><p><span style=\\"\\\\\\''FONT-SIZE:\\" 14px=\\"\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 显示屏尺寸: 11.6 英寸&nbsp;&nbsp;&nbsp; 内存大小: 2 GB&nbsp;&nbsp;&nbsp; 操作系统: Mac</span></p><p><span style=\\"\\\\\\''FONT-SIZE:\\" 14px=\\"\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 亲们还在等什么？只要挣得相应积分，苹果随你“摘”！像苹果进军吧~</span></p>', '2012-01-03 21:36:26'),
(3, '索尼DSC-W570数码相机', '	', 'http://www.aoyouw.com/up_img/2012-01/s032131160.jpg#', 500000, '', '<p><strong><span style=\\"FONT-SIZE: 14px\\">索尼数码相机，</span><span style=\\"FONT-SIZE: 14px\\">帮你</span><span style=\\"FONT-SIZE: 14px\\">记录美好难忘的时刻</span></strong></p><p><span style=\\"FONT-SIZE: 14px\\"><span style=\\"FONT-SIZE: 14px\\">索尼DSC-W570数码相机</span></span><br /><span style=\\"FONT-SIZE: 14px\\">简约紧凑的DSC-W570搭载了25mm广角焦距和5倍光学变焦的卡尔·蔡司镜头，其精致的做工和自然流畅的外观设计更适应DSC-W570小巧紧凑的机身和宽广的光学变焦范围，能更好地配合1610万有效像素的影像传感器一起记录美好难忘的时刻。</span><br /><span style=\\"FONT-SIZE: 14px\\">DSC-W570可轻松实现全景拍摄。使用扫描全景模式在所需方向上扫描相机，相机会进行高速连续拍摄，然后接合所拍图片以构成单幅全景图像。水平扫描适合拍摄山水风景和都市风情，垂直扫描可帮助您轻松捕捉高塔和教堂全景。</span><br /><span style=\\"FONT-SIZE: 14px\\">1610万有效像素的DSC-W570外观小巧精美，并搭配5款颜色丰富您的生活，彰显成熟、时尚、热情和高贵，成为您手中的一道靓丽风景。</span></p>', '2012-01-03 21:32:16'),
